import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
<link rel="stylesheet" href="https://maxcdn.bootstra.com/bootstrap/4.0.0/css/bootstrap.min.css"></link>

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
